INSERT INTO t_message VALUES ('4841', '343', '12', '王佳佳', '2014-01-06 08:55:21', '2013-10-18管网开标\r\n10-21水厂开标\r\n10-24 管网中标通知书\r\n10-28 水厂中标通知书\r\n10-25 通用第一次对接会\r\n11-15 发出通用确定事项函\r\n11-20签订水厂合同 29日历天完成\r\n11-20 签订管网合同 24日历天完成\r\n11-21 通用协调会\r\n11-28 发出沙朗河水位确定函\r\n12-16 收到11-21开会会议纪要\r\n12-17 收到水位确定回复函（10年一遇）\r\n12-24 董事长查看工地\r\n12-25 与通用一起参观楚雄水厂\r\n14.1.2 在院里讨论，确定更改加药间、滤池与反冲洗泵房合建、回收水池、钢结构封闭等问题\r\n1.2 提交土建建筑图、工艺流程图计算土方平衡\r\n1.3 与西南院第一次对接', '1');
