INSERT INTO t_message VALUES ('5227', '432', '38', ' 李  燕 ', '2014-02-17 17:11:25', '2014年2月17日，我院设计人员同通用水务自来水有限公司工作人员到项目现场对接关于上海城邦给水工程相关事宜，对接的有关问题整理如下，待落实的问题及需提供的资料请建设方落实提供。\r\n1、兴苑路、马街北路、西府路均敷设DN300市政给水管，请提供三条道路的道路施工图，包括道路平面图、纵断面图及标准横断面图；根据通用及建设方要求，西府路仅在马街北路至兴苑路段安装市政给水管，建设方在报道路消防时是否会被要求整条道路安装市政给水管及道路消火栓？\r\n2、请提供A1-1、A1-2、A1-3地块图纸（包括建筑图、水施图），要求图纸可见且可操作（原提供的图纸不可见）；\r\n3、该项目公建部分如何挂表计量用水，请分栋号回复；\r\n4、原设计给水立管部分穿商铺或安装在卫生间等地，按照公司要求，表前给水管及水表必须安装在方便抄收维护的公共区域内，此部分给水管管位需做调整；\r\n5、按照公司要求，水表每3-4层集中设置，不可每层设表；\r\n6、超高层供水方式为串联供水，需在29层避难层设置加压泵房，根据项目的实际情况，建议采用无负压叠压设备，以尽可能节能、尽可能减少噪音及振动；建设方提供的避难层内设置生活泵房的地方刚好在28F住户主卧室正上方，建议将避难层生活泵房调整至客厅厨房上方，尽量减小对住户的影响。\r\n', '1');
